import React, { useState } from 'react';


function App() {
    const [input, setInput] = useState({
        fName : "",
        lName : "",
        eMail : "",
        phoneNo : ""
    });
    const Inputval = (e) => {
        const value = e.target.value;
        const name = e.target.name;
        if(name === "fName"){
            setInput({ ...input ,fName : value});
        }else if(name === "lName"){
            setInput({ ...input ,lName : value});
        }else if(name === "eMail"){
            setInput({ ...input ,eMail : value});
        }else if(name === "phoneNo"){
            setInput({ ...input ,phoneNo : value});
        }

    };


    const Submit = (e) => {
        e.preventDefault();
        alert("form submited");
    };

    return(
        <>
            <div>
                <form onSubmit={Submit}>
                <h1>Hello {input.fName} {input.lName}</h1>
                <p>{input.eMail}</p>
                <p>{input.phoneNo}</p>

                    <input type="text" placeholder='Enter Your First Name' onChange={Inputval} name="fName" value={input.fName} />
                    <input type="text" placeholder='Enter Your Last Name' onChange={Inputval} name="lName" value={input.lName} />
                    <input type="text" placeholder='Enter Your E-Mail' onChange={Inputval} name="eMail" value={input.eMail} />
                    <input type="number" placeholder='Enter Your Phone Number' onChange={Inputval} name="phoneNo" value={input.phoneNo} />

                    <button type='submit'>Click Me</button>
                </form>
            </div>
        </>
    );
}

export default App;
